import {useState, useEffect} from 'react'
import TraineeCard from './TraineeCard'
import axios from 'axios'
import {Link} from 'react-router-dom'


const ListTrainees = () => {

    const api = "http://localhost:8088/api/v1/trainees/"
    const [traineeList, setTraineeList] = useState([])

    useEffect(() => {
        loadTrainees()
    }, [])

    const loadTrainees = () => {
        axios.get(api)
                .then(response => {setTraineeList(response.data)})
                .catch(error => console.log('unable to load data'))
    }

    return(
        <div>
            {
                traineeList.map(
                    trainee => <TraineeCard key={trainee.id} trainee={trainee}/>
                )
            }
            <br/><Link to="/register">Add a new trainee</Link>
        </div>
    )
}

export default ListTrainees
